import React from "react";

export default function PictureCollection()
{
    return (
        <div>
            <h2>Picture Collection</h2>

            <div className="pic-col">
                <img className="pic" src="https://donttakefake.com/wp-content/uploads/2022/04/gernika-pikasso-dtf-magazine10-scaled.jpeg"/>
                <img className="pic" src="https://arthive.com/res/media/img/orig/article/c2e/7567110@2x.jpg"/>
                <img className="pic" src="https://miro.medium.com/v2/resize:fit:800/1*iz1yrQE4txllek3fqCrEQw.jpeg"/>
                <img className="pic" src="https://www.artnews.com/wp-content/uploads/2021/06/Screen-Shot-2021-06-07-at-10.36.05-AM.png?w=513"/>
                <img className="pic" src="https://arthive.com/res/media/img/oy800/article/196/7567105@2x.jpg"/>
            </div>
        </div>
    )
}
